import ExpenseItem from "./components/ExpenseItem";

function App() {
  const data = [
    {
      id: 1,
      title: "Car Insurance",
      date: new Date(2022, 2, 14),
      amount: 234.54,
    },
    {
      id: 2,
      title: "Toilet Paper",
      date: new Date(2022, 3, 19),
      amount: 453.45,
    },
    {
      id: 3,
      title: 'Car Washer',
      amount: 5625.
    }
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem
        title={data[0].title}
        date={data[0].date.toISOString()}
        amount={data[0].amount}
      />
      <ExpenseItem
        title={data[1].title}
        date={data[0].date.toISOString()}
        amount={data[1].amount}
      />
    </div>
  );
}

export default App;
